ggplot.rainbow = function(n) {
  return(sapply(0:(n-1), function(i) {
    #     return(hcl(h=(i*(360/n)), c=100, l=65))
    return(hcl(h=((360-(i+1))*(360/n)), c=100, l=65))
  }))
}

